import React from "react";
import styled from "styled-components";
import { PortfolioCard } from "../share-components/Cards/PortfolioCard";
import { CardTitle } from "../share-components/Cards/CardTitle";

function Portfolio(){
    return(
        <Wrapper>
            <TitleContainer>
                <CardTitle>Web application</CardTitle>
            </TitleContainer>
            <CardContainer>
                <PortfolioCard title="Password Generator"/>
                <PortfolioCard title="Simon Says"/>
                <PortfolioCard title="Simon Says"/>
                <PortfolioCard title="Password Generator"/>
                <PortfolioCard title="Simon Says"/>
                <PortfolioCard title="Simon Says"/>
                <PortfolioCard title="Password Generator"/>
                <PortfolioCard title="Simon Says"/>
                <PortfolioCard title="Simon Says"/>
                <PortfolioCard title="Password Generator"/>
                <PortfolioCard title="Simon Says"/>
                <PortfolioCard title="Simon Says"/> 
            </CardContainer>


            {/* <CardTitle>Software application</CardTitle>
            <CardContainer>
                <PortfolioCard title="Password Generator"/>
                <PortfolioCard title="Simon Says"/>
            </CardContainer> */}


        </Wrapper>
    )
}

export {Portfolio}

const Wrapper = styled.div`
display:flex;
flex-direction:row;
height: 100%;
width: 100%;

`;

const CardContainer = styled.div`
display:flex;
flex-wrap:wrap;
border:2px solid red;
`;

const TitleContainer = styled.div``;
